import { SphinxJsonRpcProvider, fetchNameForNetwork } from '@sphinx-labs/core'
import { ethers } from 'ethers'
import * as dotenv from 'dotenv'

dotenv.config()
;(async () => {
  // const rpcUrl = 'https://zkevm-rpc.com'
  const rpcUrl = 'https://public-node.testnet.rsk.co'
  const provider = new SphinxJsonRpcProvider(rpcUrl)
  const networkName = fetchNameForNetwork(
    await provider.getNetwork().then((n) => n.chainId)
  )
  console.log(networkName)
  const wallet = new ethers.Wallet(process.env.PRIVATE_KEY!, provider)
  const initCodeWithArgs =
    ''
  const rcpt = await (
    await wallet.sendTransaction({
      data: initCodeWithArgs,
    })
  ).wait()
  console.log(rcpt!.gasUsed)
})()
